import { makeStyles } from "@material-ui/core/styles";

export const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
  headDataBox: {
    display: "flex",
    flexDirection: "row",
  },
  headDataItem: {
    margin: theme.spacing(0, 1),
    fontSize: theme.typography.h4.fontSize,
    textAlign: "center",
  },
  logo: {
    width: "50px",
  },
}));
